import styles from "./nav.scss";
import React, {useState} from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import MainPage from "./../../routes/projects/components/mainPage";
import ContactPage from "./../../routes/contact/components/contactPage";
import AboutPage from "./../../routes/about/components/aboutPage";

const Nav = () => {
  const [open, setOpen] = useState("!active");
  if(open === "active" ) {console.log(open)};
  if (open === "!active") {console.log(open)};
  //&& open === "!false" ? open: !open
  // && open === "!active" ? "!active": "active"
  return (
<Router>
    <div className={styles} id="nav">
      <nav>
        <ul className={open === "!active" ? "active": "!active"}>
          <li className = "nav-item">
            <Link to="/projects">Work</Link>
          </li>
          <li className = "nav-item">
            <Link to="/about">About</Link>
          </li>
          <li className = "nav-item">
            <Link to="/contact">Contact</Link>
          </li>
          <li className = "nav-item">
            <Link
              to={{
                pathname:
                  "https://drive.google.com/file/d/1yswrnbyyW2jdyKnh3BWLWITevmLxe3Qh/view?usp=sharing",
              }}
              target="_blank"
            >
              {" "}
              Resume{" "}
            </Link>
          </li>
        </ul>

        <div className="hamburger" 
        onClick={() => setOpen("active") }>
          <span className="bar"></span>
          <span className="bar"></span>
          <span className="bar"></span>
        </div>
      </nav>

      <Switch>
        <Route path="/projects">
          <MainPage />
        </Route>
        <Route path="/about">
          <AboutPage />
        </Route>
        <Route path="/contact">
          <ContactPage />
        </Route>
      </Switch>
    </div>
  </Router>
  )
}

export default Nav;
